import React from 'react';

const Home = () => {
  return (
    <div style={{ padding: 20 }}>
      <h1>Welcome to My Portfolio</h1>
      <p>This is my personal portfolio built with the MERN stack.</p>
    </div>
  );
};

export default Home;
